import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://www.instagram.com/lacorgi/?__a=1&max_id=endcursor")
    .then(response => response.json())
    .then(data => setData(data.graphql.user));
  }, [])

  return (
    <div className="App">
      <img src={data.profile_pic_url_hd} />
      {console.log(data)}
      {/* { data.map((item) => {
        console.log(item.node.owner.profile_pic_url)
        return <img src={item.node.owner.profile_pic_url} />
      })} */}
    </div>
  );
}

export default App;
